import React from 'react'
import { TextField, Box, Grid} from '@mui/material'


class LanguageBar extends React.Component {
    render() {
        return (
            <Grid container >

            </Grid>
        );
    }
}


class DetectBox extends React.Component {

    render() {
        return (
            <Box component="form" noValidateautoComplete="off">
                <TextField
                id="outlined-multiline-static"
                placeholder="Type Here"
                multiline
                fullWidth
                rows={9}
                /> 
            </Box>      
        );
    }
}

class TranslatedBox extends React.Component {

    render() {
        return (
            <Box component="form" noValidateautoComplete="off">
                <TextField
                id="outlined-multiline-static"
                placeholder="Translation"
                multiline
                disabled
                fullWidth
                rows={9}
                />    
            </Box>
        );
    }
}


class Translator extends React.Component {
    render() {
        return (
            <Grid container alignItems='center' justifyContent='center' style={{minHeight: '80vh'}}>
                <Grid container rowSpacing={0} columnSpacing={1} maxWidth='70vw'>
                    <Grid item xs={12}>
                        <Box sx={{ bgcolor: '#2E3B55', height: '10vh' }} />
                    </Grid>
                    <Grid item xs={6}>
                        <DetectBox />
                    </Grid>
                    <Grid item xs={6}>
                        <TranslatedBox />
                    </Grid>     
                </Grid>    
            </Grid>  
        );
    }
}


export default Translator
